import { withWidth } from '@material-ui/core';
import zIndex from '@material-ui/core/styles/zIndex';
import React,{useState,useEffect} from 'react'

const MurPiece = ({
    num
}) => {
    const epaisseur=5



    return ( 
        <div 
            style={{
                width:"100%",
                height:epaisseur,
                backgroundColor:"black",
                bottom:0
            }}
        >
        </div>

    );
}
 
export default MurPiece;
